# Main function
def main():
    # Set default page to 'main' if no session state is set
    if 'page' not in st.session_state:
        st.session_state['page'] = 'main'

    page = st.session_state['page']

    # Check current page and navigate accordingly
    if page == 'main':
        show_homepage()
    elif page == 'page2':
        import page2
        page2.show_page()
    elif page == 'page3':
        import page3
        page3.show_page()
    elif page == 'page4':
        import page4
        page4.show_page()
    elif page == 'page5':
        import page5
        page5.show_page()
    elif page == 'page6':
        import page6
        page6.show_page()
    elif page == 'page7':
        import page7
        page7.show_page()

if __name__ == '__main__':
    main()
